import './nav.css';
import logo from './logo.png'

function Navbar() {

  return (
    <>
      <div className='nav_container'>
        <div>
          <img src={logo}
            alt='logo' width='50px'
          />
        </div>
      </div>
      {/* <Category /> */}
    </>
  )
}

export default Navbar;
